package string;

import org.junit.Assert;
import org.junit.Test;

import java.util.HashMap;
import java.util.Map;

/**
 * @author : Wissen Solutions.
 */
public class CommonSubString {
    @Test
    public void testHealthy(    ) {
       // Assert.assertEquals("YES", twoStrings("", ""));
        Assert.assertEquals("NO", twoStrings("hi", "world"));
        Assert.assertEquals("YES", twoStrings("hello", "world"));
    }

    private String twoStrings(String s1, String s2) {
        Map<Character,Boolean> map = new HashMap<>();
        if(s1.length() < s2.length()) {
            for (int i = 0; i < s1.length(); i++) {
                map.put(s1.charAt(i), true);
            }

            for (int i = 0; i < s2.length(); i++) {
                if (map.containsKey(s2.charAt(i))) {
                    return "YES";
                }
            }
        } else {
            for (int i = 0; i < s2.length(); i++) {
                map.put(s2.charAt(i), true);
            }

            for (int i = 0; i < s1.length(); i++) {
                if (map.containsKey(s1.charAt(i))) {
                    return "YES";
                }
            }
        }
        return "NO";
    }




}
